int f[100][100];

int LeftValue = 0;
int RightValue = 0;
int TopValue = 0;
int BottomValue = 0;
int NowValue = 0;
int GoalXValue = 0;
int GoalYValue = 0;
int GoalX = 99;
int GoalY = 30;

void find(int y, int x) {
	f[y][x] = 1;
	NowValue++;
	printf("%d, %d\n", y, x);
	if (y == GoalY && x == GoalX)
		printf("Find End\n");

	if (x + 1 < 100 && maps[y][x + 1] != 1 && f[y][x + 1] == 0) {
		GoalXValue = abs(GoalX - (x + 1));
		GoalYValue = abs(GoalY - y);
		printf("GoalXValue = %d \n", GoalXValue);
		RightValue = NowValue + GoalXValue + GoalYValue;
		printf("RightValue = %d \n",RightValue);
	}
	if (x - 1 >= 0 && maps[y][x - 1] != 1 && f[y][x - 1] == 0) {
		GoalXValue = abs(GoalX - (x - 1));
		GoalYValue = abs(GoalY - y);
		printf("GoalXValue = %d \n", GoalXValue);
		LeftValue = NowValue + GoalXValue + GoalYValue;
		printf("LeftValue = %d \n", LeftValue);
	}
	if (y - 1 >= 0 && maps[y - 1][x] != 1 && f[y - 1][x] == 0) {
		GoalXValue = abs(GoalX - x);
		GoalYValue = abs(GoalY - (y - 1));
		printf("GoalYValue = %d \n", GoalYValue);
		TopValue = NowValue + GoalXValue + GoalYValue;
		printf("TopValue = %d \n", TopValue);
	}
	if (y + 1 < 100 && maps[y + 1][x] != 1 && f[y + 1][x] == 0) {
		GoalXValue = abs(GoalX - x);
		GoalYValue = abs(GoalY - (y + 1));
		printf("GoalYValue = %d \n", GoalYValue);
		BottomValue = NowValue + GoalXValue + GoalYValue;
		printf("BottomValue = %d \n", BottomValue);
	}
	
	
	if (RightValue != 0 && RightValue < LeftValue && RightValue < TopValue && RightValue < BottomValue) {
		printf("RightValue go = %d \n", RightValue);
		find(y, x + 1);
	}
	if (LeftValue != 0 && LeftValue < RightValue && LeftValue < TopValue && LeftValue < BottomValue) {
		printf("LeftValue go = %d \n", LeftValue);
		find(y, x - 1);
	}
	if (TopValue != 0 && TopValue < LeftValue && TopValue < RightValue && TopValue < BottomValue) {
		printf("TopValue go = %d \n", TopValue);
		find(y - 1, x);
	}
	if (BottomValue != 0 && BottomValue < LeftValue && BottomValue < RightValue && BottomValue < TopValue) {
		printf("BottomValue go = %d \n", BottomValue);
		find(y + 1, x);
	}
	f[y][x] = 0;
}

